import React from 'react'
import {View, Text, StyleSheet} from 'react-native'
export default function Home(props) {
  return (
    <View>
        <Text style= {{color:'red', backgroundColor:'yellow'}}>Welcome to Python flask and React native</Text>
        <Text style = {{color:'green', padding:10, margin:20}}>This is my second Text from Home function</Text>
        <Text>{props.name}</Text>
    </View>
  )
}

const styles = StyleSheet.create({
    textStyle:{
        color:'green',
        padding:10,
        margin:20
    }
})
